import React from 'react';
import { GoogleLogin } from '@react-oauth/google';

function Login() {
  const handleSuccess = (response) => {
    console.log('Success:', response);
    // Aquí puedes manejar el token de Google para autenticar al usuario en tu backend
  };

  const handleFailure = (error) => {
    console.log('Error:', error);
  };

  return (
    <div className="login">
      <h2>Iniciar Sesión</h2>
      <form>
        <input type="email" placeholder="Correo electrónico" />
        <input type="password" placeholder="Contraseña" />
        <button type="submit">Iniciar Sesión</button>
      </form>
      <div style={{ marginTop: '20px' }}>
        <GoogleLogin
          onSuccess={handleSuccess}
          onFailure={handleFailure}
          text="signin_with"
          width="240" // Ajusta el ancho del botón
          theme="filled_blue" // Cambia el tema, puedes probar con otros valores como 'outline'
          size="large" // Puedes cambiar el tamaño: 'small', 'medium', 'large'
        />
      </div>
    </div>
  );
}

export default Login;
